이용할 경우 프로토타이핑이니까 에러 신경 쓸 시간에 개발을 더 하자. 보통은 이렇게 시작했다가 꼼꼼하신 러스트 컴파일러께서 컴파일도 잘 안 시켜주셔서 결국은 디버깅하고 에러 메시지를 다 만들게 됩니다. 나는 이 프로그램이 절대 에러가 안 날 것이라는 확신이 있다. 머리 속에서 암산으로 다 끝낼 수 있는 수준의 처리라면 에러가 안 나게 만드는 것도 가능하기는 한데 그걸 왜 코딩을 하시죠? 이용할 도구들 unwrap(Result): 러스트 처음 배울 때 자주 등장해서 친숙한데 사실은 별로 좋은 에러처리 방법이 아닙니다. Result를 받아서 unwrap한 다음 Ok이면 값을 반환하고 에러이면 에러를 반환합니다. unwrap_err(Result) -> E: unwrap과 반대로 작동합니다. unwrap해서 Ok이면 에러를 반환하고 에러이면 에러의 값을 Ok로 반환합니다. use std::fs; fn main() { let content = fs::read_to_string("./a.b").unwrap(); println!("{}", content)
} 아래의 코드도 거의 똑같이 작동합니다. use std::fs; fn main() { let content = fs::read_to_string("./a.b"); let content = match content { Ok(f) => f, Err(e) => panic!("{:?}", e), }; println!("{}", content)
} 파일을 읽어서 스트링으로 변환하는데 해당 파일이 없을 수도 있겠죠. 컴파일은 우리가 던져주는 코드 외에는 아는게 없으니까요. 그래서 모든 것이 불안한 러스트 컴파일러에게는 명령 외에 명령이 실패했을 때 어떻게 할 지도 던져줘야 합니다. 그게 이 문서에 다룰 '에러 핸들링'입니다. 그 때 사용할 수 있는 가장 원시적인 수준의 방식이 unwrap입니다. unwrap은 말 그대로 앞의 결과물을 열어보는 것입니다. Result<T, E>를 받아서 T이면 T의 값을 반환하고 E이면 panic을 일으키는 거죠. 사실 아무 것도 안 한다고 보시면 됩니다. 넘겨받은 값을 unwrap했더니 에러이면 어떻게 될까요? panic이 발생하고 프로그램은 종료됩니다. panic에 대해서 모르는 분은 이 책보다는 러스트북 내용을 참고하세요. 이 문서의 내용과도 겹칩니다. 언어를 배울 때 나오는 예시 코드에서는 unwrap을 많이 사용합니다. 특히 입문 단계의 코드에서요. 하지만 그건 더 이상 설명을 피하기 위해서 임시방편으로 쓰는 것입니다. 실제 작동할 코드에서 unwrap을 쓰는 건 추천하지 않습니다.

