error_chain을 쓰면 함수에서 에러의 타입을 간단하게 변환할 수 있습니다. 물론 그 전에 ErrorKind에 해당 에러타입을 추가해둬야겠죠. 아래 예시도 러스트 쿡북의 예시를 가져왔습니다. 앞 장 에서 다뤘던 커스텀에러와 똑같은 방법인데 커스텀 에러, 커스텀 Result를 따로 지정하지 않아도 되니 훨씬 간단해집니다. // reqwest를 사용하기 때문에 해당 크레이트를 Cargo.toml에 넣어야합니다.
use error_chain::error_chain; error_chain! { foreign_links { Io(std::io::Error); Reqwest(reqwest::Error); // 이런 식으로 새로운 라이브러리에서 만들어놓은 Error 타입을 추가하면 됩니다. ParseIntError(std::num::ParseIntError); } errors { RandomResponseError(t: String) } // 만들어 쓰실 커스텀 에러는 여기에 추가하면 됩니다.
} fn parse_response(response: reqwest::blocking::Response) -> Result<u32> { let mut body = response.text()?; // 에러가능위치1: reqwest::Error body.pop(); body .parse::<u32>() .chain_err(|| ErrorKind::RandomResponseError(body)) // parse 메서드의 결과물은 Result인데 여기에 .chain_err()를 체이닝했습니다. .chain_err의 인자에 들어간 ErrorKind의 원소가 에러 타입이 됩니다. 에러가능위치2: RandomResponseError // map_err 메서드를 써서 아래와 같이 적어도 되겠죠. // body // .parse::<u32>() // .map_err(|e| Error::with_chain(e, ErrorKind::RandomResponseError(body)))
} fn run() -> Result<()> { let url = format!("https://www.random.org/integers/?num=1&min=0&max=10&col=1&base=10&format=plain"); let response = reqwest::blocking::get(&url)?; // 에러가능위치3: reqwest::Error let random_value: u32 = parse_response(response)?; // 에러1이나 2가 나왔으면 에러가 나오겠죠. 여기서의 에러타입은 두 개의 타입을 모두 가질 수 있는 Error가 됩니다. println!("a random number between 0 and 10: {}", random_value); Ok(())
} fn main() { if let Err(error) = run() { // run()의 결과가 에러 1, 2, 3 중 하나 때문에 Err(error)일 때 match *error.kind() { ErrorKind::Io(_) => println!("Standard IO error: {:?}", error), // 에러의 종류를 불러내는 메서드를 써서 *error.kind()가 무엇인지에 따라서 다르게 처리합니다. 앞 장에서 버블링해서 올린 에러를 어떻게 처리할 지를 다룬 내용과 동일한 방식입니다. ErrorKind::Reqwest(_) => println!("Reqwest error: {:?}", error), ErrorKind::ParseIntError(_) => println!("Standard parse int error: {:?}", error), ErrorKind::RandomResponseError(_) => println!("User defined error: {:?}", error), _ => println!("Other error: {:?}", error), } }
}

