102,256,204"; let rgb = Rgb::from_reader(csv.as_bytes()) // 에러1이 발생할 경우 여기서 에러 .chain_err(|| "Cannot read CSV data")?; // 그러면 여기서 에러 메시지3 추가 println!("{:?} to hexadecimal #{:X}", rgb, rgb); Ok(())
} fn main() { if let Err(ref errors) = run() { // run()에서 에러가 발생하면 eprintln!("Error level - description"); // 에러 메시지 헤드 출력 errors .iter() .enumerate() .for_each(|(index, error)| eprintln!("└> {} - {}", index, error)); // 에러 메시지 3 출력->에러 메시지 2 출력 -> 에러메시지 1 출력 -> 기본 에러메시지 출력 if let Some(backtrace) = errors.backtrace() { eprintln!("{:?}", backtrace); // 백트레이스 나머지가 있으면 여기서 출력(RUST_BACKTRACE=1일 경우) } }
