예시 코드를 하나 만들어서 컴파일러가 알려주는 에러들을 살펴봅시다. 1.49기준으로 나오는 에러들입니다. // free type alias without body
// 즉 type 키워드가 type alias로 인식되었고
// type alias는 바디가 없으면 안 됩니다.
// type A;
// type alias로 인식되었고 에러가 나지 않습니다.
type B = i32; fn c() { // type alias로 인식되었고 에러가 나지 않습니다. type D = i32; // type alias로 인식되었고 바디가 없다고 에러가 납니다. // type E;
} 일반적인 환경에서나 함수에서 type 키워드가 쓰이면 모두 type alias로 인식됩니다. type alias는 반드시 우변, body가 필요하다고 말해주고요. 구조체에서는 어떨까요? struct F { // 구조체에는 identifier가 나와야 하는데 // type이라는 키워드가 나와서 바로 에러입니다. // type G = i32; // type H;
} // 구조체를 정의할 때는 `type`키워드 자체가 나오면 안 된다고 하네요. 구조체의 목적을 생각해보면 당연하죠. // 마지막으로 가장 중요한 trait에서 어떻게 작동하는지 봅시다. trait I { // J, K는 associated type으로 인식하고 에러가 나지 않습니다. // type J; type K; // L, M은 associated type으로 인식하고 // associated type defaults are unstable 라는 에러가 나옵니다. // type L = i32; // type M = i32;
} impl I for F { // associated type으로 인식하고 // associated type은 impl에서 바디가 꼭 있어야 한다는 // 에러가 나옵니다. // type J; // associated type으로 인식하고 에러가 나오지 않습니다 type K = i32; // associated type으로 인식하고 // associated type은 impl에서 바디가 꼭 있어야 한다는 // 에러가 나옵니다. // type L; // associated type으로 인식하고 에러가 나오지 않지만 // trait에서 이미 에러가 났죠. // type M = i32; // N, O는 I 트레잇 소속이 아니라서 is not a member of trait `I` 에러가 나옵니다. // type N; // type O = i32;
} 최대한 많은 경우의 수를 보여드렸는데 정리하면 다음과 같습니다. 위치 해석 body trait 블록 associated type 없어야 함(허용 예정) trait 구현 블록 associated type 있어야 함 나머지 type alias 있어야 함 trait 블록에서 fn키워드(메서드)의 경우에는 시그니처만 있어도 되고 함수 구현이 들어가면 기본값이 됩니다. 그런데 type키워드(associated type)는 아직 기본값을 줄 수 없습니다. 1.49 기준으로 unstable하여 아직은 기본값을 지정할 수 없다고 합니다.
